class Solution(object):
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        s1Counts, s2Counts = {}, {}
        for c in s1:
            s1Counts[c] = s1Counts.get(c, 0) + 1
        incrL = len(s1) - 1
        numEqualCounts = 26 - len(s1Counts)
        for i in range(len(s2)):
            s2Counts[s2[i]] = s2Counts.get(s2[i], 0) + 1
            numEqualCounts += int(s1Counts.get(s2[i], 0) == s2Counts[s2[i]])
            numEqualCounts -= int(s1Counts.get(s2[i], 0) == s2Counts[s2[i]]-1)
            if i > incrL:
                i -= len(s1)
                s2Counts[s2[i]] -= 1
                numEqualCounts += int(s1Counts.get(s2[i], 0) == s2Counts[s2[i]])
                numEqualCounts -= int(s1Counts.get(s2[i], 0) == s2Counts[s2[i]]+1)
            if numEqualCounts == 26:
                return True
        return False


s = Solution()
print(s.checkInclusion('abc', 'abeidbaooo') == False)
print(s.checkInclusion("ky", "ainwkckifykxlribaypk") == True)
print(s.checkInclusion('ab', 'eidbaooo') == True)
print(s.checkInclusion('ab', 'eidboaoo') == False)
print(s.checkInclusion("adc", "dcda") == True)
print(s.checkInclusion("vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz",
"") == True)
print(s.checkInclusion("",
"") == True)
